// for now if you want to test any component you created test from this file

import { AppBar, Box, Button, Container, Typography } from '@mui/material';
import './App.css';
import HeaderAppBar from './components/HeaderAppBar';
import { AuthContextProvider } from './components/contexts/AuthContext';
import Recommender from './components/recommendator/Recommender';
import SavedStocksTableView from './components/saved_stocks/SavedStocksTableView';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './components/home/Home'
import Header from './components/Header';


function App() {

  return (
    <AuthContextProvider>
        <div className="App">
        <BrowserRouter>
          <div className='header'>
            <AppBar position='static'>
              <Container>
              <Typography
                  variant="h6"
                  noWrap
                  component="a"
                  href="/"
                  sx={{
                    mr: 2,
                    display: { md: 'flex' },
                    fontFamily: 'monospace',
                    fontWeight: 900,
                    letterSpacing: '.3rem',
                    color: 'inherit',
                    textDecoration: 'none',
                  }}
                >
                  ARBITRAGE SYSTEM
                </Typography>

                <div
                style={{
                  display: 'flex',
                  flexDirection: 'row'
                }}>
                  <Button
                  // onClick={handleNavigate('/')}
                  sx={{ my: 2, color: 'white', display: 'flex' }}>Home</Button>
                  <Button
                  // onClick={handleNavigate('/recommender')}
                  sx={{ my: 2, color: 'white', display: 'flex' }}>Recommender</Button>
                  <Button
                  // onClick={handleNavigate('/your-stocks')}
                  sx={{ my: 2, color: 'white', display: 'flex' }}>Your Stocks</Button>
                </div>
              </Container>
            </AppBar>
          </div>

          <Routes>
            <Route
            path='/'
            element={<Home/>}/>

            <Route
            path='/recommender'
            element={<Recommender/>}/>

            <Route
            path='/your-stocks'
            element={<SavedStocksTableView />}/>
          </Routes>

          </BrowserRouter>
          {/* <Recommender/> */}
      </div>
    </AuthContextProvider>


  );
}

export default App;
